import "../style/Header.css"

import { NavLink } from "react-router-dom";

import LogoImg from "../assets/logo.png";



function Header() {
  return (
    <div className="header">
      <img src={LogoImg}/>
      <nav >
        <NavLink to="/" className="tw"> Tutti </NavLink>
        <NavLink to="/" className="tw"> Prima Cat </NavLink>
        <NavLink to="/" className="tw"> Seconda Cat </NavLink>
        <NavLink to="/" className="tw"> Terza Cat </NavLink>
        <NavLink to="/" className="tw"> Quarta Cat </NavLink>
      </nav>
    </div>
  )
}

export default Header
